// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <0.9.0;
import "./BaseContract.sol";

contract Registration is BaseContract{

/*
    EgitimBilgileri egitimBilgileri;

 
   struct Company
    {
      bool status;
      bytes32 country;
      uint identityNumber;
      bytes32 name;
    }
     struct PublicInstitution
    {
      bool status;
      bytes32 name;
      bytes32 country;
    }
      struct NGO
    {
      bool status;
      bytes32 name;
      bytes32 country;
    }
    struct Course
    {
      bool status;
      bytes32 name;
      bytes32 country;
    }
    
    struct  Person
    {
      bool status;
  
    }
       struct Universite
        {
        bool durum;
        bytes32 isim;
        uint8 ulke;
        }

        struct Akademisyen
        {
        bool durum;
        address universite;
        uint16 bolum;
        Unvan unvan; 
        bytes32 name;
        bytes32 surname;
        }

        enum Unvan { DR, AS_PROF, PROF,MD }    



 
    mapping(address=>Universite) public universities;
    mapping(address=>Akademisyen) public academicians;
    mapping(address=>Company) public  companies;
    mapping(address=>Course) public  courses;
    mapping(address=>PublicInstitution) public publicInstitutions;
    mapping(address=>NGO) public ngos;
    mapping(address=>Person) public people;
*/

    event PersonRegisteredLog(address _personAddress);
    event AkademisyenEkleLog(address _akademisyenAdres,address _universiteAdres, bytes32  _ad,bytes32  _soyad,uint16  _bolum,Unvan _unvan);
    event UniversiteKayitLog(address _universiteAdres,bytes32  _isim, uint8 _ulke);
    event FirmaEkleLog(address _firmaAdres,bytes32  _isim, uint _vergiNo,bytes32  _ulke);
    event KamuKurumuEkleLog(address _kamuKurumuAdres,bytes32  _isim,bytes32  _ulke);
    event STKEkleLog(address _stkAdres,bytes32  _isim,bytes32  _ulke);
    event KursEkleLog(address _kursAdres,bytes32  _isim,bytes32  _ulke);
    event SertifikaMerkeziEkleLog(address _smAdres,bytes32  _isim,bytes32  _ulke);
    
    constructor (address _yok, address _tobb, address _cb){
        YOK=_yok;
        TOBB=_tobb;
        CB=_cb;
    }
    /*
    modifier onlyYOK{
      require(msg.sender == YOK,
      "Sadece YOK bu islemi yapabilir."
      );
      _;
    }    
    
    modifier onlyTOBB{
      require(msg.sender == TOBB,
      "Sadece TOBB bu islemi yapabilir."
      );
      _;
    }    
    modifier onlyCB{
      require(msg.sender == CB,
      "Sadece CB bu islemi yapabilir."
      );
      _;
    }    
    modifier onlyUniversity{
      require(universities[msg.sender].durum,
      "Sadece Universite bu islemi yapabilir."
      );
      _;
    } 
    modifier onlyCourse{
      require(courses[msg.sender].status,
      "Bu islemi sadece Kurs yapabilir."
      );
      _;
    } 
     modifier Only_Uni_Comp_Publ{
      require(universities[msg.sender].durum||companies[msg.sender].status||publicInstitutions[msg.sender].status,
      "Bu islemi sadece Kurs yapabilir."
      );
      _;
    } 
      modifier onlyOwner {
      require(msg.sender == address(this),
      "Bu islemi sadece kontrat sahibi yapabilir");
      _;
   }
     function isPerson(address _address) public view returns(bool){
        return people[_address].status;
    }

      function isCompany(address _address) public view returns(bool){
        return companies[_address].status;
    }
      function isPublicInstitution(address _address) public view returns(bool){
        return publicInstitutions[_address].status;
    }

      function isCourse(address _address) public view returns(bool){
        return courses[_address].status;
    }
       function isNGO(address _address) public view returns(bool){
        return ngos[_address].status;
    }

    */
 function ekleUniversite(address _universiteAdres,bytes32 _isim, uint8 _ulke)  public sadeceYOK{
        require(!universiteler[_universiteAdres].durum,
            "Universite Zaten Mevcut"
            );
        universiteler[_universiteAdres]=Universite(true,_isim, _ulke);
        emit UniversiteKayitLog( _universiteAdres, _isim, _ulke);
    }
    /*
  function registerStudent(address _studentAddress,EgitimBilgileri.EducationInfo memory _egitimBilgileri)   public onlyUniversity{
        require(!people[_studentAddress].status,
            "Student exists already"
            );
            
        people[_studentAddress].status=true;
        people[_studentAddress].educations.push(_egitimBilgileri) ;

        emit PersonRegisteredLog( _studentAddress);
    }
    function addYabanciDil(address _studentAddress,YabanciDilBilgileri.YabanciDil memory _ydBilgi)   public Only_Uni_Comp_Publ{
       require(people[_studentAddress].status,
            "Student not exists"
            );
     
        people[_studentAddress].yabanciDiller.push(_ydBilgi) ;

        emit YabanciDilEklendiLog(_ydBilgi.onayKurumTipi, _ydBilgi.onayKurum,  _ydBilgi.basTarih,  _ydBilgi.bitTarih, _ydBilgi.ogretimTipi, _ydBilgi.ogretimDili);
    }
    */
     function ekleAkademisyen(address _akademisyenAdres,address _universiteAdres, bytes32 _ad, bytes32 _soyad,uint16 _bolum, Unvan _unvan)   public sadeceUniversite{
        require(!akademisyenler[_akademisyenAdres].durum,
            "Akademisyen Zaten Mevcut"
            );
       akademisyenler[_akademisyenAdres]=Akademisyen( true,_universiteAdres, _bolum,  _unvan,  _ad,  _soyad);
       emit AkademisyenEkleLog( _akademisyenAdres,_universiteAdres,  _ad,  _soyad,  _bolum, _unvan);
    }
  function ekleFirma(address _firmaAdres,bytes32 _isim, uint _vergiNo,bytes32 _ulke) 
  public sadeceTOBB{
        require(!firmalar[_firmaAdres].durum,
            "Firma Zaten Mevcut"
            );
            
        firmalar[_firmaAdres].durum=true;
        firmalar[_firmaAdres].isim=_isim;
        firmalar[_firmaAdres].ulke=_ulke;
        firmalar[_firmaAdres].vergiNo=_vergiNo;

        emit FirmaEkleLog( _firmaAdres,  _isim,  _vergiNo,  _ulke);
       
    }
     function ekleKamuKurumu(address _kamuKurumuAdres,bytes32 _isim, bytes32 _ulke) 
     public sadeceCB{
        require(!kamuKurumlari[_kamuKurumuAdres].durum,
            "Kamu Kurmu Zaten Mevcut"
            );
            
        kamuKurumlari[_kamuKurumuAdres].durum=true;
        kamuKurumlari[_kamuKurumuAdres].isim=_isim;
        kamuKurumlari[_kamuKurumuAdres].ulke=_ulke;

        emit KamuKurumuEkleLog( _kamuKurumuAdres,  _isim, _ulke);
       
    }
     function ekleKurs(address _kursAdres,bytes32 _isim, bytes32 _ulke) 
     public sadece_Uni_Firma_Kamu{
        require(!kurslar[_kursAdres].durum,
            "Kamu Kurumu Zaten Mevcut"
            );
            
        kurslar[_kursAdres].durum=true;
        kurslar[_kursAdres].isim=_isim;
        kurslar[_kursAdres].ulke=_ulke;
        
        emit KursEkleLog( _kursAdres,  _isim, _ulke);
       
    }
     function ekleSTK(address _stkAdres,bytes32 _isim, bytes32 _ulke) 
     public sadeceCB{
        require(!stklar[_stkAdres].durum,
            "Sivil Toplum Kurulusu Zaten Mevcut"
            );
            
        stklar[_stkAdres].durum=true;
        stklar[_stkAdres].isim=_isim;
        stklar[_stkAdres].ulke=_ulke;
        
        emit STKEkleLog( _stkAdres,  _isim, _ulke);
       
    }
     function ekleSertifikaMerkezi(address _smAdres,bytes32 _isim, bytes32 _ulke) 
     public sadeceTOBB{
        require(!sertifikaMerkezleri[_smAdres].durum,
            "Sertifika Merkezi Zaten Mevcut"
            );
            
        sertifikaMerkezleri[_smAdres]=SertifikaMerkezi(true,_isim,_ulke);

        
        emit SertifikaMerkeziEkleLog( _smAdres,  _isim, _ulke);
       
    }
}

